import React from 'react';
import './App.css';

function App() {
  return (
    <div>
        <img alt="Weather Png"></img>
        <p>Current Temperature Here</p>
        <p>weather description here (e.g. partly cloudy)</p>

    </div>
  );
}

export default App;
